import './career.scss';
import Caroussel from '../caroussel/caroussel';
import Header from '../header/header';
import Footer from '../footer/footer';
import ServiceItem from '../serviceItem/serviceItem';
import WebService from '../webService/webService';
import AppService from '../appService/appService';
import CloudService from '../cloudService/cloudService';
import AiService from '../aiService/aiService';
import EnterpriseService from '../unknown/unknown';

const Career = (): JSX.Element => {
    return (
        <>
            <Header />
            <div className="career">
                    <ServiceItem clasNameAdded="" title="Web" rowElements={<WebService />}/>
                    <ServiceItem clasNameAdded="" title="App" rowElements={<AppService />}/>
                    <ServiceItem clasNameAdded="" title="Cloud" rowElements={<CloudService />}/>
                    <ServiceItem clasNameAdded="" title="AI" rowElements={<AiService />}/>
                    <ServiceItem clasNameAdded="" title="Unknown" rowElements={<EnterpriseService />}/>
            </div>
        </>
    );
}

export default Career;
